import React, { Component } from 'react';
import Slider from 'infinite-react-carousel';


class Carousel extends Component {
    render(){
        return(
            <Slider dots arrowsBlock>
                <div>
                    <h3>hi1</h3>
                </div>
                <div>
                    <h3>hi2</h3>
                </div>
                <div>
                    <h3>hi3</h3>
                </div>
            </Slider>
        )
    }
}
export default Carousel;
